import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import RoomListing from "./components/RoomListing";
import BookingForm from "./components/BookingForm";
import BookingDetails from "./components/BookingDetails";
import "./App.css";
import MyBookings from "./components/MyBookings";
import Home from "./components/Home"; // ✅ Import your real Home component

// Dummy Admin Component (replace later with actual admin panel)
const AdminPanel = () => (
  <div style={{ padding: "20px" }}>
    <h2>Admin Panel</h2>
    <p>Here the admin can manage rooms and bookings.</p>
  </div>
);

function App() {
  return (
    <Router>
      <Navbar />
      <div className="container">
        <Routes>
          <Route path="/" element={<Home />} />  {/* ✅ Use imported Home */}
          <Route path="/rooms" element={<RoomListing />} />
          <Route path="/booking/:roomId" element={<BookingForm />} />
          <Route path="/bookings" element={<BookingDetails />} />
          <Route path="/mybookings" element={<MyBookings />} />
          <Route path="/admin" element={<AdminPanel />} />

          <Route path="/booking/:roomId" element={<BookingForm />} />

        </Routes>
      </div>
    </Router>
  );
}

export default App;
